        desc: '<div class="pane" style="display: block;"><div><div class="text"><ul><li>Brzina kretanje napred do&nbsp;10 mph (16 km/h),&nbsp;brzina unazad do&nbsp;6 mph (10 km/h) &nbsp;direktno menjanje pravca za prave linije</li> <li>Odravanje brzine prilkom obeleavanja, LineDriver pomae da dobijete istu debljinu linija</li> <li>Ekskluzivni dizajn papuica za upravljanje napred-nazad</li> <li>Ekskluzivni napredni sistem za smanjenje vibracija (patent je u toku) eleminie vibraciju motora i omoguava zadravanje kvaliteta izvuenih linija</li> <li>Ekskluzivni&nbsp;FlexBeam Break-A-Way&nbsp;sistem svetla omoguava rad prilkom slabog osvetljenja&nbsp;(patent je u toku)</li> </ul><p>&nbsp;</p><ul><li>Forward speeds to 10 mph (16 km/h), reverse speeds to 6 mph (10 km/h)  change directions instantly for consistent lines</li> <li>By maintaining striping speed, LineDriver helps you produce a more consistent line thickness (film build) for more precise and longer-lasting stripes</li> <li>Exclusive dual pedal design (patented) for forward and reverse</li> <li>Exclusive Advanced Vibration Reduction System (patent pending) eliminates engine vibration while keeping line quality the best in the industry</li> <li>Exclusive FlexBeam Break-A-Way Light System is fully adjustable for all types of low light conditions (patent pending)</li> </ul></div></div><div class="clear"></div></div>',
