        desc: '<div class="pane" style="display: block;"> <div><p>LineLazer V 5900&nbsp;i<b>&nbsp;</b>3900<b>&nbsp;</b>i dalje<b>&nbsp;</b>su prepoznate kao maine za profesionalnu signalizaciju. Sa mogunou da koriste 1 ili 2 pitolja&nbsp;nijedan posao nije premali ili preveliki za&nbsp;LineLazer V 5900 i 3900  veliki parkinzi,&nbsp;ulice u gardu itd. Godinama su pozante dobavljaima kao profesionalne maine po svojoj produktivnosti, inovacije nove generacije 5900 i 3900 nadmauju sva oekivanja.</p> <div class="image"></div><div class="text"><p><b>Karakteristike standardne serije:</b></p> <ul><li>EasyMark sistem za podeavanje pitolja <ul><li>Jednostavno za upotrebu</li> <li>Lako iskljuivanje/ukljuivanje, napred/nazad</li> <li>Svaki put savreno podeavanje</li> </ul></li><li>EZ poravnat sistem prednjeg toka <ul><li>Omoguava odravanje pravca</li> <li>Novi dizajn</li></ul></li><li>DualComfort&nbsp;sistem ruki sa ipkama <ul><li>Uklapa se sa svim korisnicima</li> <li>Lako se prilagoava</li> <li>vrst zahvaljujui 4 zavrtnja</li> </ul></li><li>LiveLook ekran sa&nbsp;SmartControl <ul><li>Praenje svakog segmenta tokom rada</li> <li>Informacije u realnom vremenu</li> </ul></li></ul></div><div>&nbsp;<b>HP Automatic Series ukljuuje sve karakteristike kao&nbsp;Standard Series PLUS:</b></div> <div class="parbase image_left section textimage"> <div class="text"><ul><li>Automatski pitolj<ul><li>Dugme za kontrolu kako bi dobili precizne linije</li> </ul></li><li>Auto-Layout II<ul><li>Duplo skrauje vreme</li> <li>Ekskluzivni zeleni laser za navoenje (zavisi od zemlje)</li> </ul></li><li>uvanje podataka zahvaljujui J-Log System <ul><li>uva informacije kao dokaz o obavljenom poslu</li> </ul></li><li>Snaga tokom rada<ul><li>12V baterija za dodatnu opremu</li> </ul></li></ul></div><p>&nbsp;</p></div><p>The LineLazer V 5900<b>&nbsp;</b>and 3900<b>&nbsp;</b>continues to be the mid to heavy-duty striping solution for professional contractors who recognize the increased productivity this leader delivers. With its ability to use 1 or 2-gun airless paint guns there are no jobs too big or small for the LineLazer V 5900&nbsp;and 3900  large parking lots, city streets and everything in between. Known for years by professional contractors for its productivity, the innovations of this new generation positions the 5900 and 3900 to again exceed all expectations.</p> <div class="image"></div><div class="text"><p><b>Standard Series Features:</b></p> <ul><li>EasyMark Gun Adjustment System <ul><li>Simple guide mark system</li> <li>Easy gun on/off, front/back</li> <li>Perfect gun set up  every time</li> </ul></li><li>EZ Align Front Wheel System <ul><li>Keeps unit tracking straight</li> <li>Intuitive design</li></ul></li><li>DualComfort Handle Bar System <ul><li>Fits all users</li><li>Easy to adjust</li><li>Solid 4-bolt design</li> </ul></li><li>LiveLook Display with SmartControl <ul><li>Tracks all aspects of the job</li> <li>Real-time information</li> </ul></li></ul></div><div class="parbase image_left section textimage"> <div class="text"><p><b>HP Automatic Series Includes All Standard Series Features PLUS:</b></p> <ul><li>Automatic Guns<ul><li>Push button control for accurate stripes every time</li> </ul></li><li>Auto-Layout II<ul><li>Cuts layout time in half</li> <li>Exclusive Green Laser Guidance (country dependant)</li> </ul></li><li>Data Logging with J-Log System <ul><li>On-board job information for proof of completion</li> </ul></li><li>On-Board Power<ul><li>12V battery for all your accessory items</li> </ul></li></ul></div></div></div><div class="clear"></div></div>',
