        spec: '<div class="pane" style="display: block;"><p><b>Novi okvir</b><br> 7.6 cm (3 inches) dui u odnosu na prethodni model za veu stabilnost i prave linije<br> Rezervoar od 57 L (15-gallon) i EZ sistem za perle</p> <p><b>EasyMark sistem za podeavanje pitolja</b><br> G sistem spone omoguava brze pokrete</p> <p><b>Ruka za upravljanje</b><br> Podesivi dizajn umanjuje vibracije i dovodi do smanjenje umora tokom rada</p> <p><b>Zadni nosa creva</b><br> Omoguava jednostavno ukljuivanje i iskljuivanje tokom rada</p> <p><b>Jednostavna kontrola</b><br> Komande za upravljanje se nalaze na rukama to omoguava podeavanja bez zaustavljanja</p> <p><b>Honda&nbsp;motor</b><br>Odlina snaga i dokazana pouzdanost</p> <p><b>Izdrljivost pumpe</b><br> Provereno najbolja pumpa&nbsp;na ovom polje</p> <p><b>EasyOut&nbsp;filter za pumpu</b><br> Velika povrina filtera umanjuje zaepljenje dizni i osigurava kvalitet boje</p> <p><b>Ukljuuje</b><br>Flex Plus&nbsp;pitolj za obeleavanje<br> LineLazer RAC 5&nbsp;diznu i nosa dizne<br> 1/4 in x 50 ft BlueMax II Airless</p> <p>&nbsp;</p><p>&nbsp;</p><p><b>New Frame</b><br>3 inches longer than the previous version for greater stability and straighter lines<br> Now accepts the 15-gallon hopper and the EZ Bead system</p> <p><b>EasyMark Gun Adjustment System</b><br> G clamp system allows for quick movement of gun and guide marks for perfect gun alignment every time</p> <p><b>Handle Bar System</b><br> Adjustable design, allows for optimal ergonomics and reduced vibration for all-day striping comfort with less fatigue</p> <p><b>Rear Mount Hose Wrap</b><br> Provides easy on and off for stenciling applications</p> <p><b>Easy Reach Controls</b><br> Operator controls are located on the handle bars allowing adjustments to be made without stopping</p> <p><b>Honda Engine</b><br>Contractor preferred, excellent power and proven reliability</p> <p><b>Endurance Pump</b><br>Industry-best pump performance in this field-proven design</p> <p><b>Advantage Drive</b><br>With hardened steel gears, this is the longest lasting drive in the industry</p> <p><b>EasyOut Pump Filter</b><br> Large filtering area reduces tip clogs and ensures paint quality</p> <p><b>Includes</b><br>Flex Plus Striping Gun<br>LineLazer RAC 5 SwitchTip and Guard<br> 1/4 in x 50 ft BlueMax II Airless Hose</p> <p><strong>Tehnike karakteristike</strong></p> <table class="techspecs_table"> <tbody><tr><td class="techspecs_title" colspan="2"><strong>LineLazer 3400</strong></td> </tr><tr><td class="techspecs_subheader" colspan="2">Honda GX120&nbsp;motor</td> </tr><tr><td class="techspecs_desc">ANSI&nbsp;snaga @ 3600 rpm</td> <td class="techspecs_value"><div class="usvalue">4.0&nbsp;konjska snaga</div> </td></tr><tr><td class="techspecs_subheader" colspan="2">Maksimalni radni pritisak</td> </tr><tr><td class="techspecs_desc"></td> <td class="techspecs_value"><div class="usvalue">3300 psi</div> </td></tr><tr><td class="techspecs_subheader" colspan="2">Nivo buke</td> </tr><tr><td class="techspecs_desc">Snaga zvuka</td> <td class="techspecs_value"><div class="usvalue">100 dBa prema ISO 3744</div> </td></tr><tr><td class="techspecs_desc">Pritisak zvuka</td> <td class="techspecs_value"><div class="usvalue">86 dBa meren na&nbsp;3.1 ft</div> </td></tr><tr><td class="techspecs_subheader" colspan="2">Nivo vibracije meren prema ISO 5349 na osnovu 8&nbsp;sati rada</td> </tr><tr><td class="techspecs_desc">Leva ruka</td> <td class="techspecs_value"><div class="usvalue">3.89 m/sec</div> </td></tr><tr><td class="techspecs_desc">Desna ruka</td> <td class="techspecs_value"><div class="usvalue">4.94 m/sec</div> </td></tr><tr><td class="techspecs_subheader" colspan="2">Maximum delivery rating</td> </tr><tr><td class="techspecs_desc"></td> <td class="techspecs_value"><div class="usvalue">0.75 gpm</div> </td></tr><tr><td class="techspecs_subheader" colspan="2">Maksimalna veliina dizne</td> </tr><tr><td class="techspecs_desc"></td> <td class="techspecs_value"><div class="usvalue">1 pitolj sa&nbsp;0.027&nbsp;dizne</div> </td></tr><tr><td class="techspecs_subheader" colspan="2">Filter za ulaznu boju</td> </tr><tr><td class="techspecs_desc"></td> <td class="techspecs_value"><div class="usvalue">mesh od 12 okaca sa ramom od nerajueg elika za viestruku upotrebu</div> </td></tr><tr><td class="techspecs_subheader" colspan="2">Filter za izlaznu boju</td> </tr><tr><td class="techspecs_desc"></td> <td class="techspecs_value">mesh od 60 okaca sa ramom od nerajueg elika za viestruku upotrebu</td> </tr><tr><td class="techspecs_subheader" colspan="2">Veliina dovodne pumpe</td> </tr><tr><td class="techspecs_desc"></td> <td class="techspecs_value"><div class="usvalue">1-12 unf-2b</div> </td></tr><tr><td class="techspecs_subheader" colspan="2">Veliina izlaza za tenost</td> </tr><tr><td class="techspecs_desc"></td> <td class="techspecs_value"><div class="usvalue"> npsm from fluid filter</div> </td></tr><tr><td class="techspecs_subheader" colspan="2">Delovi obloeni sa</td> </tr><tr><td class="techspecs_desc"></td> <td class="techspecs_value"><div class="usvalue">PTFE, najlon, poliuretan, UHMW polietilen, FKM, acetal, koa, Volfram karbid, niklovani-ugljeni elik, nerajui elik,&nbsp;hromirano</div> </td></tr><tr><td class="techspecs_subheader" colspan="2">Dimenzije</td> </tr><tr><td class="techspecs_desc">Teina</td> <td class="techspecs_value"><div class="usvalue">68 kg (150 lb)</div> </td></tr><tr><td class="techspecs_desc">Visina</td> <td class="techspecs_value"><div class="usvalue">40.5 in</div> </td></tr><tr><td class="techspecs_desc">irina</td> <td class="techspecs_value"><div class="usvalue">32 in</div> </td></tr><tr><td class="techspecs_desc">Duina</td> <td class="techspecs_value"><div class="usvalue">61.5 in</div> </td></tr></tbody></table><div class="clear"></div></div>'
