    	desc: '<div class="section-content__content "><section><div class="rov split-image-content"><div class="col-sm"><div class="force-stand-font">Najmocniji elektrini airless pitolj. Mark X HD 240 volti je prskalica po izboru za ozbiljne profesionalne izvoae sa skoro duplo vecom snagom od Mark V HD. Lako prska obradni premaz u zavrnoj obradi nivoa 5, zavrnoj obradi sa vie tekstura i svim prajmerima i bojama.</div><p>Radite pametnije, zavrite vie poslova. Mark HD ProContractor serija elektrinih prskalica za teksturu bez vazduha dizajnirane su da isporue brzinu i amper; performanse tako da moete bre doci do sledeceg radnog mesta i povecati svoj profit.</p> <ul class="splitColumns"><li><strong>Endurance Vortex MaxLife klipna pumpa</strong><br> <ul><li>Superiorni vek trajanja pumpe</li><li>Vrhunska tehnologija rotiranja klipa</li> <li>Do 6x dui vek trajanja pumpe</li> <li>Inovativna tehnologija klipa</li> <li>Najduzi vek trajanja pokretnih delova. Mogunost odabira kuglica, keramikih ili elinih</li> </ul></li><li><strong><strong><strong>MaxFlo 2 sa zatitom od pakovanja</strong> <br></strong></strong> <ul><li>Manji broj servisnih intervala, vea produktivnost</li><li>Mogunost samoicenja maine</li><li>Optimizovani prolazi za tenost za najtee premaze</li> </ul></li><li><strong><strong><strong>BlueLink Job &amp; Sistem za upravljanje prskalicom</strong><br></strong></strong> <ul><li>Pojednostavite svoje poslovanje</li><li>Pratite svoju mainu, tanu lokaciju i produktivnost po satu</li> <li>Pratite napredak svog posla: podaci o produktivnost sa bilo kog mesta</li></ul></li><li><strong>SmartControl 4.0 sa ProGuard sistemom zatite</strong><br> <ul><li>Precizna kontrola pritiska</li><li>Konstantan pritisak bez fluktuacije</li> <li>ProGuard spreava elektrina otecenja usled ekstremnih uslova napajanja na gradilitu</li> <li>WatchDog sistem zatite pumpe automatski spreava otecenje pumpe ako je nivo materijala prenizak</li> </ul></li><li><strong>QuickReel sistem za upravljanje crevima</strong> <br><ul><li>Jednostavno upravljanje crevima</li><li>Postavite i premotajte crevo do 300 stopa (90 metara) za nekoliko sekundi</li><li>Bez uvrtanja, savijanja i namotavanja</li><li>Koristite samo crevo koje vam je potrebno  ostalo ostaje na koturu</li></ul></li> <li><strong>ProConnect 2 sistem za zamenu pumpe</strong> <br> <ul><li>Eliminiite skupe zastoje</li><li>Zamena pumpe za nekoliko minuta</li><li>Bez alata</li> </ul></li><li><strong>Ulazno cjedilo otporno na lomljenje</strong> <br> <ul><li>Izdrljiva filtracija</li><li>Izdri jake pritiske kako bi se odrao ravnomeran protok kroz filter</li> </ul></li><li><strong>Motor MaxPower bez brige</strong> <br> <ul><li>Zavrite vie posla</li><li>Dokazane performanse za sve aplikacije za farbanje</li> <li>Dizajn bez etkica visokog obrtnog momenta sa doivotnom garancijom</li> <li>Koristite due kablove, bez obzira na fluktuacije napona</li> </ul></li><li><strong>Precision Advantage Drive</strong><br> <ul><li>Dugotrajna upotreba</li><li>Poboljani uslovi na gradilitu uz izuzetno tih rad</li></ul></li><li><strong>Dodatne funkcije:</strong><br><ul><li>WatchDog sistem zatite pumpe</li><li>Easy Out Filter Manifold</li><li>Otporni glavni ventil</li><li>Robustan i izdrljiv dizajn kolica sa postoljem za noge</li> </ul></li></ul></div></section></div>',
