    	id: 49,
    	desc: '<div><h2>Karakteristike</h2></div> <div> <p><strong>ist i suv kompresorski vazduh sa Airblast Aftercoolers</strong></p> <p>Kopresorska klima je neophodna&nbsp;kako bi se osiguralo&nbsp;besprekorno peskarenje i rasprivanje boje,&nbsp;kao i za alate sa komprimovanim vazduhom.</p> <p><img src="https://www.airblast.com/media/prod/f8427586221df35843c43fe77bbd8d76_2a6c106c4e3442cf6806a61aea430cf9.jpg" alt=""></p> <p>Komprimovani vazduh doprinosi boljem kvalitetu blastiranih povrina jer je vei deo ulja i vode uklonjen iz vauduha.&nbsp;Komprimovani vazduh poboljava produktivnost, olakava odravanje i smanjuje operativne trokove.</p> <p>Najea kontaminacija komprimovanog vazduha je vode. Voda u obliku pare ulazi u vazduni sistem preko ulaza kompresora i koncentruje se do zasienja.&nbsp;Kako se hlaenje odvija nizvodno od kompresora vlaga u zasienom vazduhu se kondezuje u vodu.</p> <p>Drugi kontaminant je ulje, koje ulazi u sistem kompresora podmazivanjem. Nekoliko litara ulja na taj nain mogu ui u vazduni sistem tokom vremena.</p> <p>Airblast oprema za komprsiju vazduha uklanja sve zagaivae i osigurava suv i ist vazduh.</p> </div>',
